  true,\n\t\"url\": null,\n\t\"notes\": \"<p>This website provides demographic information
  about laboratories, including CLIA number, facility name and address, where the
  laboratory testing is performed, the type of CLIA certificate, and the date the
  certificate expires. This list is updated monthly and represents the information
  in the system at the time of update. For additional information about a particular
  laboratory, contact the appropriate State Agency or Regional Office CLIA contact
  (refer to State Agency or Regional Office CLIA link found on the left-hand navigation
  pane).</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
